import{
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
const router = createBrowserRouter([
  {
    path:"/",
    element : <div> this is home</div>,
  },{
    path : "/login",
    element : <div> this login page</div>,
  },
  {
    path : "/register",
    element: <div> this is register page</div>,
  },
  {
    path : "/Write",
    element : <div> this is Write</div>,
  },
]);

function App() {
  return (
    <div className="App">
      <RouterProvider router={router}/>
    </div>
  );
}

export default App;
